// in reusable table farghesh ba oon yaki ine ke Parameters midim samte server :)))
// Products ro bebin to swagger

import React, { useEffect } from "react";
import { SearchBox } from "../../reusable_operations/SearchBox";
import { NavLink } from "react-router-dom";
import { AddItem_btn } from "../../add_or_edit_product/AddItem_btn";

export const Reusable_table2 = ({
  nameOfColumn, // ÿßÿ≥ŸÖ Ÿáÿ± ⁄©ÿØÿßŸÖ ÿßÿ≤ ÿ≥ÿ™ŸàŸÜ Ÿáÿß- ŸáÿØÿ±Ÿáÿß
  dataOfRows, //⁄©ŸÑ ÿØ€åÿ™ÿßŸáÿß€å€å ⁄©Ÿá ÿßÿ≤ ÿ®⁄© ÿßŸÜÿØ ŸÖ€å⁄Ø€åÿ±€åŸÖ
  placeholder_searchBox,
  go_where, //this icon ‚ûï link to where - hamishe ham link nist
  show_addButton,
}) => {
  useEffect(() => {
    console.log(dataOfRows);
  }, []);

  return (
    <div className="reusable_table">
      <div className="d-flex align-items-center justify-content-between">
        {/* ================== üîç start searchBoxüëá ================== */}
        <SearchBox />
        {/* ================== üîç end searchBoxüëÜ ==================== */}
        {/* ================== ‚ûï start show_addButtonüëá ================== */}
        <NavLink to={"/"}>
          <AddItem_btn />
        </NavLink>
        {/* ================== ‚ûï end show_addButtonüëÜ ==================== */}
      </div>
      <table className="table_of_reusable_table table table-striped table-responsive text-center table-hover table-bordered">
        <thead>
          <tr>
            {nameOfColumn.map((h) => (
              <th>{h.title}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {dataOfRows.map((d) => (
            <tr>
              {nameOfColumn}
              <td>{d}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};
